import React from "react";

class Pokemon extends React.Component {
  render() {
    const { name, type, averageWeight } = this.props;
    return(
      <div>
        <h2>{name}</h2>
        <p>{type}</p>
        <p>{averageWeight.value} {averageWeight.measurementUnit}</p>
      </div>
    )
  }
}

export default Pokemon;
